text_show:
Pbentaha sa produkto:
1.Ang mga produkto nakapasar sa sertipikasyon sa CE;
2.Ang frame nagsagop sa 12 # H-beam structurial steel, nagpataas sa mas lig-on nga seguridad;
3.Gipalig-on nga materyal alang sa dugang nga kalig-on ug pagdala sa luwan;
4.Fully enclosed type steel rail,nagdala sa puwersa mas lig-on;
5. Paggamit sa gipalig-on nga baga nga kadena, lig-on ug lig-on, mas luwas nga kargamento;
6. Ang disenyo sa pagdumala sa ergonomya, komportable nga pagbati sa kamot, pataas ug ubos nga kontrol nga sayon;
7. Ang ligid gihimo sa taas nga kusog nga materyal nga naylon nga ligid, mahimong magtuyok sa 360 °, flexible nga operasyon;
8. Ang pag-alsa sa pedal mas sayon, gamit ang prinsipyo sa leverage, ang pedal gipalugway, ug ang tiil mas makadaginot sa trabaho
